import './index.scss'
import PortfolioItem from '../PortfolioList';

function Portfolio() {

    const list = [
        {
          id: "featured",
          title: "Featured",
        },
        {
          id: "web",
          title: "Web App",
        },
        {
          id: "mobile",
          title: "Mobile App",
        },
        {
          id: "design",
          title: "Design",
        },
        {
          id: "content",
          title: "Content",
        },
    ];

    return(
        <div className="portfolio" id="portfolio">
            <h1>Portfolio</h1>
            <ul>
                <PortfolioItem title="Project One" />
            </ul>
            <div className="container">
            </div>
        </div>
    )
}

export default Portfolio;
